import React from 'react'
import styled from 'styled-components'

const Button = styled.div`
  width: 100px;
  height: 100px;

  img{
    width: 100%;
    height: 100%;
  }
`

function CommuModal() {
  const url = "../images/commu.png";
  return (
    <>
      <Button>
        <img src={url} alt="버튼" />
      </Button>
    </>
  )
}

export default CommuModal
